import Card from './Card'
import React from 'react';

const CardContainer = ({data}) => {
    const rows = []
    let lastCategory = null
    data.forEach(produit => {
      if(produit.categorie !== lastCategory){
        lastCategory = produit.categorie
        rows.push(<ProductCategoryRow key={produit.categorie} categorie={produit.categorie}/>)
      }
      rows.push(<ProductRow key = {produit.name} produit={produit}/>)
    })
    return (
        <div className="card">                   
            <Card key={data.index} src={data.src}></Card>    
        </div>

    );
};

export default CardContainer;
